import React, { useState } from 'react';
import {
  Box,
  Container,
  Button,
  Grid,
  Paper,
  Typography,
  TextField,
} from '@mui/material';
import { makeStyles } from '@material-ui/core';

import Hero from '../../Hero/Hero';
import Footer from '../../Footer/Footer';

const MacroCalculator = (props) => {
  return (
    <Box>
      <Container maxWidth="lg">
        <h1>Macro Calculator</h1>

        <Box
          component="form"
          sx={{
            '& > :not(style)': { m: 1, width: '25ch' },
          }}
          noValidate
          autoComplete="off"
        >
          <TextField
            id="outlined-basic"
            label="Weight (lb)"
            variant="outlined"
          />
          <TextField
            id="outlined-basic"
            label="Height (ft)"
            variant="outlined"
          />
          <TextField
            id="outlined-basic"
            label="Height (in)"
            variant="outlined"
          />
          <TextField id="outlined-basic" label="Age" variant="outlined" />
        </Box>
      </Container>
    </Box>
  );
};

export default MacroCalculator;
